import header from "../images/bgi.jpg";
import React from "react";

export default function Banner() {
  let bannerstyle = {
    height: "100vh",
    width: "100vw",
  };
  let contaner_style = { position: "relative" };

  return (
    <>
      <div style={contaner_style}>
        <img src={header} alt="" id="banner" style={bannerstyle} />
        <div class="centered">Centered</div>
      </div>
    </>
  );
}
